package itk.aakb.dk.gg_saarpleje;

import android.content.Intent;
import android.os.Environment;
import android.test.ActivityInstrumentationTestCase2;
import android.util.Base64;

import java.io.File;
import java.io.FileOutputStream;
import java.util.Date;

/**
 * Created by rimi on 05/01/16.
 */
public class ReportActivityTest extends ActivityInstrumentationTestCase2<ReportActivity> implements MediaHandlerListener {
    public ReportActivityTest() {
        super(ReportActivity.class);
    }

    private static final String FILE_DIRECTORY = "saarpleje";
    private File mediaStorageDir;

    @Override
    protected void setUp() throws Exception {
        super.setUp();
        mediaStorageDir = new File(Environment.getExternalStoragePublicDirectory(Environment.DIRECTORY_PICTURES), FILE_DIRECTORY);
    }

    public void testFinishReport() {
        // Ensure that media storage directory exists.
        if (!mediaStorageDir.exists()) {
            mediaStorageDir.mkdirs();
        }

        assertTrue("Media directory exists", mediaStorageDir.exists());

        // Create some files in media storage.
        for (int i = 0; i < mediaItems.length; i++) {
            String filename = String.format("image-%03d.jpg", i);
            File file = new File(mediaStorageDir, filename);

            byte[] data = Base64.decode(mediaItems[i], Base64.DEFAULT);
            try {
                FileOutputStream fos = new FileOutputStream(file);
                fos.write(data);
                fos.close();
            } catch (Exception ex) {}

            assertTrue("Media file exists", file.exists());
        }

        String recipient_email = "googleglass@mikkelricky.dk";
        String recipient_name = "Test";
        String subject = "Google Glass SÃ¥rpleje-test " + new Date();
        Intent intent = new Intent();
        intent
                .putExtra("recipient_email", recipient_email)
                .putExtra("recipient_name", recipient_name)
                .putExtra("subject", subject);
        setActivityIntent(intent);
        ReportActivity activity = getActivity();
        activity.finishReport();
    }

    @Override
    public void onResult(boolean result) {
        assertTrue(result);

        File[] files = mediaStorageDir.listFiles();
        assertEquals("No files exist", 0, files.length);
    }

    private static String[] mediaItems = new String[] {
            "\n",
            "\n",
    };
}
